/**
 * Servicio para manejo de impresión de recibos ESC/POS
 */

const ReceiptPrinterEncoder = require('@point-of-sale/receipt-printer-encoder');
const SystemReceiptPrinter = require('@point-of-sale/system-receipt-printer');
const { createCanvas, loadImage } = require('canvas');
const config = require('../config/config');
const { printRaw } = require('../utils/print-raw');

class PrinterService {
  
  /**
   * Listar impresoras disponibles en el sistema
   * @returns {Promise<Array>} Lista de impresoras
   */
  async listPrinters() {
    try {
      const printers = SystemReceiptPrinter.getPrinters();
      return printers;
    } catch (error) {
      console.error('Error al listar impresoras:', error);
      throw new Error(`No se pudieron listar las impresoras: ${error.message}`);
    }
  }

  /**
   * Generar datos ESC/POS para un recibo
   * @param {string} content - Contenido del recibo
   * @returns {Uint8Array} Datos codificados para la impresora
   */
  encodeReceipt(content) {
    const encoder = new ReceiptPrinterEncoder({
      language: 'esc-pos',
      codepageMapping: 'epson'
    });

    const result = encoder
      .initialize()
      .codepage('cp437')
      .text(content)
      .newline()
      .newline()
      .cut()
      .encode();

    return result;
  }

  /**
   * Imprimir un recibo
   * @param {string} content - Contenido del recibo
   * @param {string} printerName - Nombre de la impresora (opcional)
   * @returns {Promise<Object>} Resultado de la impresión
   */
  async printReceipt(content, printerName = null) {
    try {
      const encodedData = this.encodeReceipt(content);
      const targetPrinter = printerName || 'InfoPos';
      
      console.log(`Imprimiendo en: ${targetPrinter}`);
      
      // Usar método RAW de Windows
      const result = await printRaw(encodedData, targetPrinter);
      
      console.log(`✓ Impreso: ${result.bytes} bytes`);
      
      return {
        printed: true,
        bytes: result.bytes,
        printer: targetPrinter,
        method: 'raw'
      };
    } catch (error) {
      throw new Error(`Error al imprimir: ${error.message}`);
    }
  }

  /**
   * Imprimir un recibo de prueba
   * @param {string} printerName - Nombre de la impresora (opcional)
   * @returns {Promise<Object>} Resultado de la impresión
   */
  async printTestReceipt(printerName = null) {
    try {
      const encoder = new ReceiptPrinterEncoder({
        language: 'esc-pos'
      });

      const fecha = new Date();

      //const imageBase64 = 'data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEAYABgAAD...'; // <-- Reemplaza con tu base64 completo
      const imageBase64 = 'data:image/jpeg;base64,';
     
      // Cargar la imagen desde base64
      const image = await loadImage(imageBase64);
      
      // Crear recibo de prueba elaborado con imagen
      const testContent = encoder
        .initialize()
        .codepage('auto')        
        // .image(image, 320, 128, 'atkinson') // Imagen con algoritmo de dithering
        .size(1,1)
        .align('center')
        .rule()
        .line('Nit 123.123.123-1')
        .line('Celular 3217816922')
        .line('eltequilazoes@gmail.com')
        .line('Cali, Valle del Cauca')
        .font('A')
        .newline()
        .qrcode('https://nielsleenheer.com')
        .newline()
        .newline()
        .newline()
        .cut()
        .encode();

      const targetPrinter = printerName || 'InfoPos';
      
      console.log(`Imprimiendo recibo de prueba en: ${targetPrinter}`);
      
      // Usar método RAW de Windows
      const result = await printRaw(testContent, targetPrinter);
      
      console.log(`✓ Recibo de prueba impreso: ${result.bytes} bytes`);
      
      return {
        printed: true,
        bytes: result.bytes,
        printer: targetPrinter,
        method: 'raw'
      };
    } catch (error) {
      throw new Error(`Error al imprimir recibo de prueba: ${error.message}`);
    }
  }
}

module.exports = new PrinterService();
